@MijaelGLP Comunicado de un grupo de " notables de carpa circense".
La mayoria de ellos son viudas de un cobarde suicida y otros , llevan fruta al asesino q está en Barbadillo..!!
Q de " notable" tienen...???

@Herpityderpette Tengo varios familiares que tienen la manía de, cuando ven empezar una peli, decir el final.

"Mira, esta es en la que al final el prota se suicida" (ejemplo inventado).

El otro día empezó una que quería ver, me lo hicieron y ahora pues pa qué.

@_mynameisdam_ @CdNLeon O cara matou o Han Solo e vai ficar de boas????
Ta, o Vader matou um monte de criancinhas e no final do Retorno de Jedi aparece o fantasma do Hayden Christensen na festinha dos Ewoks como se nada tivesse acontecido... 
As vezes acho que o maior vilão de Star Wars é o George Lucas

